import "./App.css";
import Header from "./components/Header/Header";
import Profile from "./components/Profile/Profile";

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Profile />} />
        <Route path=""/>
        <Route />
        <Route />
        <Route />
      </Routes>
    </>
  );
}

export default App;
